function Index() {
  return (
    <div>
      <h1>Clinical Record</h1>
      <main>
        <section>MUY BUENA PAGINA</section>
        <section>
          <h1>LA RECOMIENDO</h1>
        </section>
        <section>
          <h2>Contacto :v</h2>
          <address>
            <p>0800-chupala-:v</p>
          </address>
        </section>
      </main>
      <style jsx>
        {`
          section * {
            padding: 1rem;
            margin: 0;
          }
          section:nth-child(odd) {
            background-color: #606980;
          }
          section:nth-child(even) {
            background-color: #99a8cc;
          }
        `}
      </style>
    </div>
  );
}

export default Index;
